import {  createStore } from "redux"
import { Provider } from 'react-redux'

const initialState = {
  name: ""
}

const reducer = (state = initialState, action) => {}

const store = createStore(reducer)

const setName = (name) => ({
  type: "ADD_NAME",
  payload: name
})

const App = () => {
  const [name, setName] = useState("")

  const changeName = () => {
    setName("Петр")
  }

  return <button onClick={changeName}>Изменить</button>
}

const ViewName = () => {
  return <h1>Name</h1>
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <Provider store={store}>
      <App />
      <ViewName />
    </Provider>
 </React.StrictMode>
);
